import React from 'react';
import Input from './field/input';

const Question2 = ({data, onFieldChange}) => {
  return (
    <div>
      <h1 className="question">Question 2</h1>
      <p>Explain to yourself why you want to transmute into the Vision of yourself you just described. Give 3 reasons.</p>
      <ol>
        <li>
          <Input
            id="purpose1"
            type="text"
            value={data.purpose1}
            isFocused
            onFieldChange={onFieldChange}
          />
        </li>
        <li>
          <Input 
            id="purpose2" 
            type="text" 
            value={data.purpose2}
            onFieldChange={onFieldChange}
          />
        </li>
        <li>
          <Input 
            id="purpose3" 
            type="text" 
            value={data.purpose3}
            onFieldChange={onFieldChange}
          />
        </li>
      </ol>
    </div>
  );
}

export default Question2;
